GO

CREATE FUNCTION [dbo].[GETShiftEndTime](@Shift VARCHAR(5),@date date)
RETURNS DATETIME
AS
BEGIN
DECLARE @ReturnVal varchar(500)=''
DECLARE @TmpDate varchar(500)=CONVERT(VARCHAR(100),@date)
    if(@Shift='A')
	BEGIN
    SET @ReturnVal= @TmpDate+ ' 16:00:00'
	END
	ELSE if(@Shift='B')
	BEGIN
	    SET @ReturnVal=@TmpDate+  ' 23:59:59'
	END
		ELSE if(@Shift='C')
	BEGIN
	SET @TmpDate=CONVERT(VARCHAR(100),DATEADD(DAY,1, @date))
	    SET @ReturnVal=@TmpDate+  ' 07:44:59'
	END
	return @ReturnVal
END;
