CREATE FUNCTION [dbo].[GETShiftStartTime](@Shift VARCHAR(5),@date date)
RETURNS DATETIME
AS
BEGIN
DECLARE @ReturnVal varchar(500)=''
DECLARE @TmpDate varchar(500)=CONVERT(VARCHAR(100),@date)
    if(@Shift='A')
	BEGIN
    SET @ReturnVal= @TmpDate+ ' 08:00:00'
	END
	ELSE if(@Shift='B')
	BEGIN
	    SET @ReturnVal=@TmpDate+  ' 16:00:01'
	END
		ELSE if(@Shift='C')
	BEGIN
	SET @TmpDate=CONVERT(VARCHAR(100),DATEADD(DAY,1, @date))
	    SET @ReturnVal=@TmpDate+  ' 00:00:00'
	END
	return @ReturnVal
END;

