CREATE   PROC [dbo].[GET_ReportData]      
(      
@StartTime DATETIME,      
@EndTime DATETIME      
)      
AS BEGIN    
    
    
SELECT a.RunningData,b.ModelName,a.PartNumber  
,A.CreatedDate  
,A.QRSERIALNUMBER  
,A.Possition_Ma  
,A.Possition_V  
,A.LowPos_Ma  
,A.LowPos_V  
,A.LowPlusHighPlusPos_Ma  
,A.LowPlusHighPlusPos_V  
,A.LowPlusHigh_Ma  
,A.LowPlusHigh_V,
A.ErrorMessage
,A.Result  
FROM [LineRunningData] as a left join [Mst_Model] as b on a.ModelId=b.ModelId    
 where    a.CreatedDate between @StartTime and  @EndTime      
order by RunningData desc    
       
END 
