CREATE PROCEDURE [dbo].[SavePlanDetails]
(
    @PlanDetails TY_PlanDetails READONLY,
	@CreatedBy VARCHAR(1500)
)
AS
BEGIN

if exists(select 'x' from @PlanDetails where IsDefault=1)
begin
update Trn_PlanDetails set IsDefault=0
end

DECLARE @ReportDate DATE =(SELECT TOP 1 PlannedDate from @PlanDetails)

INSERT INTO Trn_PlanDetails (ModelID,AShift,BShift,CShift,PlannedDate,CreatedDate,IsDefault)
 SELECT ModelID,AShift,BShift,CShift,PlannedDate,GETDATE(),IsDefault FROM @PlanDetails as a
 WHERE ISNULL(PlanDetailsID,0)=0

 update Trn_PlanDetails set AShift=a.AShift,BShift=a.BShift,CShift =a.CShift,IsDefault=a.IsDefault
 from @PlanDetails as a inner join Trn_PlanDetails as b on a.PlanDetailsID=b.PlanDetailsID
 and b.PlannedDate=@ReportDate



END

