create proc [dbo].[Sp_GetPlaNDetails]
(
@CreatedDate DATETIME
)
AS BEGIN
if not exists(SELECT 'X' from Trn_PlanDetails where CONVERT(date,ISNULL(PlannedDate,getdate()))=CONVERT(date,@CreatedDate))
begin

INSERT INTO Trn_PlanDetails
select a.ModelID,ISNULL(b.AShift,350),ISNULL(b.BShift,350),ISNULL(b.CShift,350),CONVERT(date,@CreatedDate),getdate(),0 from Mst_Model as a 
left join Trn_PlanDetails as b on a.ModelID=b.ModelID 
and b.IsDefault=1


end
select * from Mst_Model as a 
left join Trn_PlanDetails as b on a.ModelID=b.ModelID 
and CONVERT(date,ISNULL(b.PlannedDate,getdate()))=CONVERT(date,@CreatedDate)
END
