/****** Object:  StoredProcedure [dbo].[SP_GETShiftBasedData]    Script Date: 22-03-2025 09:57:27 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
--EXECUTE SP_GETShiftBasedData '2025-02-16'  
  
CREATE PROC [dbo].[SP_GETShiftBasedData]  
(  
@ReportDate DATE,
@ModelID INT
)  
AS BEGIN  
  
CREATE TABLE #TmpData  
(  
Shift VARCHAR(10),  
ModelID INT,  
OkCount INT,  
NgCount INT  
)  
insert into #TmpData   
select 'A',ModelID,0,0 from [Mst_Model]   
UNION ALL  
select 'B',ModelID,0,0 from [Mst_Model]  
UNION ALL  
select 'C',ModelID,0,0 from [Mst_Model]  
  
  
  
update #TmpData set OkCount=a.OkOount from (  
SELECT 'A' as Shift,ModelID,COUNT(distinct QRSERIALNUMBER) as OkOount FROM [LineRunningData]  
where Result='OK' and CreatedDate between  dbo.GETShiftStartTime('A',@ReportDate)   
and dbo.GETShiftENDTime('A',@ReportDate)  and ModelID=@ModelID 
GROUP BY ModelID) as a inner join #TmpData as b on a.ModelID=b.ModelID and b.Shift='A'  
  
update #TmpData set OkCount=a.OkOount from (  
SELECT 'B' as Shift,ModelID,COUNT(distinct QRSERIALNUMBER) as OkOount FROM [LineRunningData]  
where Result='OK' and CreatedDate between  dbo.GETShiftStartTime('B',@ReportDate)   
and dbo.GETShiftENDTime('B',@ReportDate)   and ModelID=@ModelID
GROUP BY ModelID) as a inner join #TmpData as b on a.ModelID=b.ModelID and b.Shift='B'  
  
  
update #TmpData set OkCount=a.OkOount from (  
SELECT 'C' as Shift,ModelID,COUNT(distinct QRSERIALNUMBER) as OkOount FROM [LineRunningData]  
where Result='OK' and CreatedDate between  dbo.GETShiftStartTime('C',@ReportDate)   
and dbo.GETShiftENDTime('C',@ReportDate)   and ModelID=@ModelID
GROUP BY ModelID) as a inner join #TmpData as b on a.ModelID=b.ModelID and b.Shift='C'  
  
  
  
  
update #TmpData set NgCount=a.NgCount from (  
SELECT 'A' as Shift,ModelID,COUNT(distinct QRSERIALNUMBER) as NgCount FROM [LineRunningData]  
where Result='NG' and CreatedDate between  dbo.GETShiftStartTime('A',@ReportDate)   
and dbo.GETShiftENDTime('A',@ReportDate)   and ModelID=@ModelID
GROUP BY ModelID) as a inner join #TmpData as b on a.ModelID=b.ModelID and b.Shift='A'  
  
update #TmpData set NgCount=a.NgCount from (  
SELECT 'B' as Shift,ModelID,COUNT(distinct QRSERIALNUMBER) as NgCount FROM [LineRunningData]  
where Result='NG' and CreatedDate between  dbo.GETShiftStartTime('B',@ReportDate)   
and dbo.GETShiftENDTime('B',@ReportDate)   and ModelID=@ModelID
GROUP BY ModelID) as a inner join #TmpData as b on a.ModelID=b.ModelID and b.Shift='B'  
  
  
update #TmpData set NgCount=a.NgCount from (  
SELECT 'C' as Shift,ModelID,COUNT(distinct QRSERIALNUMBER) as NgCount FROM [LineRunningData]  
where Result='NG' and CreatedDate between  dbo.GETShiftStartTime('C',@ReportDate)   
and dbo.GETShiftENDTime('C',@ReportDate)   and ModelID=@ModelID
GROUP BY ModelID) as a inner join #TmpData as b on a.ModelID=b.ModelID and b.Shift='C'  
  
  
SELECT * FROM #TmpData  
END  
  
  
GO
/****** Object:  StoredProcedure [dbo].[Sp_SaveRunningData]    Script Date: 22-03-2025 09:57:27 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

  
CREATE PROC [dbo].[Sp_SaveRunningData]  
(  
 @QRSERIALNUMBER varchar(5000)  
,@Possition_Ma float  
,@Possition_V float  
,@LowPos_Ma float  
,@LowPos_V float  
,@LowPlusHighPlusPos_Ma float  
,@LowPlusHighPlusPos_V float  
,@LowPlusHigh_Ma float  
,@LowPlusHigh_V float  
,@Result  VARCHAR(1500),  
@PartNumber VARCHAR(1500) ,
@errorMessage VARCHAR(MAX)
)  
AS BEGIN  
  
DECLARE @ModelID INT=1  
  
IF(LEN(@QRSERIALNUMBER)>17)  
BEGIN  
DECLARE @MODEL VARCHAR(500)  
SET @MODEL= SUBSTRING(@QRSERIALNUMBER,8,10)  
  
IF EXISTS(SELECT 'X' FROM [Mst_Model] WHERE  ModelName=@PartNumber)  
BEGIN  
SELECT TOP 1 @ModelID=ModelID FROM [Mst_Model] WHERE  ModelName=@PartNumber  
END  
ELSE  
BEGIN  
INSERT INTO [Mst_Model] VALUES(@PartNumber,getdate(),1)  
SET @ModelID=SCOPE_IDENTITY()  
END  
  
END  
  
INSERT INTO LineRunningData  
(CreatedDate  
,QRSERIALNUMBER  
,Possition_Ma  
,Possition_V  
,LowPos_Ma  
,LowPos_V  
,LowPlusHighPlusPos_Ma  
,LowPlusHighPlusPos_V  
,LowPlusHigh_Ma  
,LowPlusHigh_V  
,Result,  
[ModelID]  
,[PartNumber],
ErrorMessage)  
VALUES(getdate()  
,@QRSERIALNUMBER  
,@Possition_Ma  
,@Possition_V  
,@LowPos_Ma  
,@LowPos_V  
,@LowPlusHighPlusPos_Ma  
,@LowPlusHighPlusPos_V  
,@LowPlusHigh_Ma  
,@LowPlusHigh_V  
,@Result,  
@ModelID,  
@MODEL,@errorMessage)  
  
  
END
GO
